function ARGB( a , r , g , b )

	if( 1 ) then return 0xffffffff;	end

	a = math.integer(a);
	r = math.integer(r);
	g = math.integer(g);
	b = math.integer(b);

	argb = (a<<24)|(r<<16)|(g<<8)|(b);

	return argb
end

sfcLibrary = {};

sfcLibrary.new = function()

   local instance = {};
   instance.str = "";
   setmetatable(instance, { __index = sfcLibrary} );

	return instance;
end

